import React from 'react'

function Cart(props) {
  console.log(props);
  return (
    <div className='cart'>
      <h2>Cart</h2>
      {props.cartItems.map((item, index) => (
        <div key={index}>
          <h1>{item.name}</h1>
          <h2>{item.price}</h2>
          {/* Include quantity if needed */}
        </div>
      ))}
    </div>
  )
}

export default Cart
